import React from 'react';
import Navbar from './Navbar'; // Import your Navbar component
import '../CSS/Contact.css'; // Import your Contact page CSS file

const Contact = () => {
  // Define an array of staff members with their contact information
  const staffMembers = [
    { name: 'John Doe', position: 'Manager', contactNo: '123-456-7890' },
    { name: 'Jane Smith', position: 'Assistant Manager', contactNo: '987-654-3210' },
    // Add more staff members as needed
  ];

  return (
    <div>
      <Navbar /> {/* Include the Navbar component */}
      <div className="contactContainer">
        <h1>Contact Us</h1>
        <p>Feel free to contact any of our staff members for assistance:</p>
        <div className="staffList">
          {staffMembers.map((staff, index) => (
            <div key={index} className="staffMember">
              <h2>{staff.name}</h2>
              <p>{staff.position}</p>
              <p>Contact No: {staff.contactNo}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Contact;
